class rgb_color{

public:
	uchar r;
	uchar g;
	uchar b;

	num sr;
	num sg;
	num sb;

public:

	rgb_color():r(0),g(0),b(0),sr(0),sg(0),sb(0){}

	rgb_color(uchar m_r, uchar m_g, uchar m_b):r(m_r),g(m_g),b(m_b),sr(r/255.0),sg(g/255.0),sb(b/255.0){}

	rgb_color(int m_hex)
	{
		r = (uchar)((m_hex >> 16) & 0xFF);
		g = (uchar)((m_hex >> 8) & 0xFF);
		b = (uchar)(  m_hex    & 0xFF);
		//
		sr = r / 255.0;
		sg = g / 255.0;
		sb = b / 255.0;
	}

	void from_hex(int m_hex)
	{
		r = (uchar)((m_hex >> 16) & 0xFF);
		g = (uchar)((m_hex >> 8) & 0xFF);
		b = (uchar)(  m_hex    & 0xFF);
		//
		sr = r / 255.0;
		sg = g / 255.0;
		sb = b / 255.0;
	}

	void from_hsl(int H, num S, num L)
	{
		if ( S == 0 )
		{
			// gray values
			sr = sg = sb =  L;
			r = g = b = (uchar) ( L * 255 );
		}
		else
		{
			double	v1, v2;
			double	hue = (double) H / 360.0;

			v2 = ( L < 0.5 ) ?
				( L * ( 1 + S ) ) :
			( ( L + S ) - ( L * S ) );
			v1 = 2 * L - v2;

			sr	=  Hue_2_RGB( v1, v2, hue + ( 1.0 / 3 ) ) ;
			sg	=   Hue_2_RGB( v1, v2, hue ) ;
			sb	=  Hue_2_RGB( v1, v2, hue - ( 1.0 / 3 ) ) ;
			r = (uchar)(sr*255);
			g = (uchar)(sg*255);
			b = (uchar)(sb*255);
		}
	}
	///
	num Hue_2_RGB( num v1, num v2, num vH )
	{
		if ( vH < 0 )
			vH += 1;
		if ( vH > 1 )
			vH -= 1;
		if ( ( 6 * vH ) < 1 )
			return ( v1 + ( v2 - v1 ) * 6 * vH );
		if ( ( 2 * vH ) < 1 )
			return v2;
		if ( ( 3 * vH ) < 2 )
			return ( v1 + ( v2 - v1 ) * ( ( 2.0 / 3 ) - vH ) * 6);
		return v1;
	}
	void from_hsv(num m_h, num m_s, num m_v)
	{
		//
		sr = r / 255.0;
		sg = g / 255.0;
		sb = b / 255.0;
	}

};

