class hsl_color{

public:
	int h;
	num s;
	num l;

public:

	hsl_color():h(0),s(0),l(0){}

	hsl_color(int m_h, num m_s, num m_l)
	{
		h = m_h;
		s = m_s;
		l = m_l;
	}

	/** 
	* @brief Convert an sRGB color to Hue-Saturation-Lightness (HSL)
	* 
	* @param H, S, L pointers to hold the result
	* @param R, G, B the input sRGB values scaled in [0,1]
	*
	* This routine transforms from sRGB to the double hexcone HSL color space
	* The sRGB values are assumed to be between 0 and 1.  The outputs are
	*   H = hexagonal hue angle                (0 <= H < 360),
	*   S = { C/(2L)     if L <= 1/2           (0 <= S <= 1),
	*       { C/(2 - 2L) if L >  1/2
	*   L = (max(R',G',B') + min(R',G',B'))/2  (0 <= L <= 1),
	* where C = max(R',G',B') - min(R',G',B').  The inverse color transformation
	* is given by Hsl2Rgb.
	*
	* Wikipedia: http://en.wikipedia.org/wiki/HSL_and_HSV
	*/
	void from_rgb(rgb_color rgb)
	{
		num max,min;

		max = MAX3(rgb.sr,rgb.sg,rgb.sb); 
		min = MIN3(rgb.sr,rgb.sg,rgb.sb);

		num delta = max - min;
		l = (max+min)/2;

		if(delta == 0)
		{
			h = 0;
			s = 0.0;
		}
		else
		{
			// get saturation value
			s = (l < 0.5) ? (delta / (max + min)) : (delta / (2 - max - min));

			// get hue value
			double del_r = (((max - rgb.sr) / 6) + (delta / 2)) / delta;
			double del_g = (((max - rgb.sg) / 6) + (delta / 2)) / delta;
			double del_b = (((max - rgb.sb) / 6) + (delta / 2)) / delta;
			double hue;

			if (rgb.sr == max)
				hue = del_b - del_g;
			else if (rgb.sg == max)
				hue = (1.0 / 3) + del_r - del_b;
			else
				hue = (2.0 / 3) + del_g - del_r;

			// correct hue if needed
			if (hue < 0)
				hue += 1;
			if (hue > 1)
				hue -= 1;

			//Hue = (int)(hue * 360);
			h = (int)(hue * 360);
		}

	}
    ///
	int quantization_16_4_4()
	{
		//Á¿»¯
		num Saturation,Luminance;
		int Hue;
		int  r_s,r_l,r_h;

		Saturation = s;
		Luminance = l;
		Hue = h;

		if(Saturation < 0.15 && Saturation>=0)		r_s = 0;
		else if(Saturation >= 0.15 && Saturation < 0.4)		r_s = 1;
		else if(Saturation >= 0.4 && Saturation < 0.75)	r_s = 2;
		else				r_s = 3;

		if(Luminance < 0.15 && Luminance>=0)		r_l = 0;
		else if(Luminance >= 0.15 && Luminance < 0.4)		r_l = 1;
		else if(Luminance >= 0.4 && Luminance < 0.75)	r_l = 2;
		else
			r_l=3;
		if ((Hue >= 0 && Hue <= 15) || (Hue < 360 && Hue > 345)) r_h=0;
		else  if (Hue > 15 && Hue <= 25) r_h=1;
		else if (Hue > 25 && Hue <= 45)  r_h=2;
		else if (Hue > 45 && Hue <= 55)  r_h=3;
		else if (Hue > 55 && Hue <= 80)  r_h=4;
		else if (Hue > 80 && Hue <= 108) r_h=5;
		else if (Hue > 108 && Hue <= 140) r_h=6;
		else if (Hue > 140 && Hue <= 165) r_h=7;
		else if (Hue > 165 && Hue <= 190) r_h=8;
		else if (Hue > 190 && Hue <= 220) r_h=9;
		else if (Hue > 220 && Hue <= 255) r_h=10;
		else if (Hue > 255 && Hue <= 275)  r_h=11;
		else if (Hue > 275 && Hue <= 290) r_h=12;
		else if (Hue > 290 && Hue <= 316) r_h=13;
		else if (Hue > 316 && Hue <= 330)  r_h=14;
		else   r_h=15;

		return 16*r_h+4*r_s+r_l;
	}

};

